import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <form>
        <div>
          <input type="text"/>
            <button type='submit'>
              Ekle
            </button>
        </div>
      </form>
    </div>
  );
}

export default App;
